import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
display:flex;
margin-top: 1rem;
justify-content:space-between;
width:95%;
border:1px solid black;
align-self:flex-end;
`;

const DetailSquare = styled.div`
padding: 0 0;
background-color: white;
height: 100px;
border-radius: 4px;
box-shadow: 0 9px 28px 0 rgba(0,0,0,0.03);
background-color: #ffffff;
flex-basis: 20%;
border:1px solid black;

`;
const Summary = () => {
    return (
        <Container>
            <DetailSquare>Total</DetailSquare>
            <DetailSquare>Approved</DetailSquare>
            <DetailSquare>Declined</DetailSquare>
            <DetailSquare>Approval Rate</DetailSquare>
        </Container>
    );
};

export default Summary;
